import { useNavigate, useParams } from "react-router-dom";
import useFetch from './useFetch';


const Ex = () => {
    const {id } = useParams()
    const {data:workout,error,isPending} = useFetch('http://localhost:8001/workouts/' + id);
    const navigate = useNavigate();

    const handleClick = ()=>{
        fetch('http://localhost:8001/workouts/' + workout.id,
            {
                method: 'DELETE'
            }
        ).then(() =>{
            navigate('/');
        })
    }
    // const  mult = (excersises) => {
    //     return (  
    //         <p> Excersise Name: {excersises[0][0]}</p>
    //         <p> Weight (lbs): {workout.excersises[0][1]}</p>
    //         <p> Sets: {workout.excersises[0][2]}</p>
    //         <p> Reps per Set: {workout.excersises[0][3]}</p>);
    // }
    //Add method for multiple Excerisese show
     
    return ( <div className="Excersises">
            {isPending && <div>Loading...</div>}
            {error && <div>{error} </div>}
           
            {workout && (
                
                <article>
                    <h2>{workout.date}</h2>
                    <h4> Workout type: {workout.type}</h4>
                    <p> Excersise Name: {workout.excersises[0][0]}</p>
                    <p> Weight (lbs): {workout.excersises[0][1]}</p>
                    <p> Sets: {workout.excersises[0][2]}</p>
                    <p> Reps per Set: {workout.excersises[0][3]}</p>
                    <p>{workout.excersises.length}</p>

                    <button onClick={handleClick}>delete</button>
                </article>
        )}

    </div>);
}
 
export default Ex;
